import React from 'react';
import ChessTable from './components/ChessTable/ChessTable';
import io from 'socket.io-client';

const socket = io("http://localhost:8080");
socket.on("connect", () => {
  console.log("A new connection has been established");
});


function App() {
  return (
    <>
    <ChessTable/>
    </>
  );
}

export default App;
